import React from "react";
import { Link } from "react-router-dom";
import { createUseStyles } from "react-jss"; // For CSS injection

import IndexNavbar from "components/Navbars/IndexNavbar.js";
import Footer from "components/Footers/Footer.js";

// CSS injection using react-jss
const useStyles = createUseStyles({
  header: {
    position: "relative",
    paddingTop: "4rem",
    display: "flex",
    alignItems: "center",
    height: "100vh",
    maxHeight: "860px",
  },
  container: {
    width: "100%",
    margin: "0 auto",
    display: "flex",
    flexWrap: "wrap",
  },
  contentBox: {
    width: "100%",
    padding: "0 1rem",
    '@media (min-width: 768px)': {
      width: "66.666667%",
    },
    '@media (min-width: 1024px)': {
      width: "50%",
    },
  },
  contentWrapper: {
    paddingTop: "8rem",
    '@media (min-width: 640px)': {
      paddingTop: 0,
    },
  },
  title: {
    fontWeight: 600,
    fontSize: "2rem",
    color: "#475569", // text-blueGray-600
    '@media (min-width: 640px)': {
      fontSize: "2.25rem",
    },
    '@media (min-width: 1024px)': {
      fontSize: "2.5rem",
    },
  },
  description: {
    marginTop: "1rem",
    fontSize: "1rem",
    lineHeight: 1.625,
    color: "#64748b", // text-blueGray-500
    '@media (min-width: 640px)': {
      fontSize: "1.125rem",
    },
  },
  buttonContainer: {
    marginTop: "3rem",
    display: "flex",
    flexDirection: "column",
    '@media (min-width: 640px)': {
      flexDirection: "row",
    },
  },
  primaryButton: {
    display: "inline-block",
    color: "white",
    fontWeight: 700,
    padding: "1rem 1.5rem",
    borderRadius: "0.25rem",
    outline: "none",
    marginRight: "0.25rem",
    marginBottom: "0.25rem",
    backgroundColor: "#0ea5e9", // bg-lightBlue-500
    textTransform: "uppercase",
    fontSize: "0.875rem",
    boxShadow: "0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06)",
    transition: "all 0.15s linear",
    width: "100%",
    textAlign: "center",
    '&:hover': {
      boxShadow: "0 10px 15px -3px rgba(0, 0, 0, 0.1), 0 4px 6px -2px rgba(0, 0, 0, 0.05)",
    },
    '&:active': {
      backgroundColor: "#0284c7", // bg-lightBlue-600
    },
    '@media (min-width: 640px)': {
      width: "auto",
    },
  },
  secondaryButton: {
    display: "inline-block",
    color: "white",
    fontWeight: 700,
    padding: "1rem 1.5rem",
    borderRadius: "0.25rem",
    outline: "none",
    marginRight: "0.25rem",
    marginBottom: "0.25rem",
    backgroundColor: "#334155", // bg-blueGray-700
    textTransform: "uppercase",
    fontSize: "0.875rem",
    boxShadow: "0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06)",
    transition: "all 0.15s linear",
    marginTop: "1rem",
    width: "100%",
    textAlign: "center",
    '&:hover': {
      boxShadow: "0 10px 15px -3px rgba(0, 0, 0, 0.1), 0 4px 6px -2px rgba(0, 0, 0, 0.05)",
    },
    '&:active': {
      backgroundColor: "#475569", // bg-blueGray-600
    },
    '@media (min-width: 640px)': {
      marginTop: 0,
      marginLeft: "0.25rem",
      width: "auto",
    },
  },
  heroImage: {
    position: "absolute",
    top: 0,
    right: 0,
    paddingTop: "0.25rem",
    width: "100%",
    height: "50%",
    objectFit: "cover",
    marginTop: "-12rem",
    '@media (min-width: 640px)': {
      width: "50%",
      height: "100%",
      marginTop: 0,
    },
    '@media (min-width: 768px)': {
      width: "50%",
    },
    '@media (min-width: 1024px)': {
      width: "50%",
    },
  },
});

export default function Index() {
  const classes = useStyles();
  
  return (
    <>
      <IndexNavbar fixed />
      <section className={classes.header}>
        <div className={classes.container}>
          <div className={classes.contentBox}>
            <div className={classes.contentWrapper}>
              <h2 className={classes.title}>
                BIENVENUE SUR UBCI HR MANAGER
              </h2>
              <p className={classes.description}>
                UBCI RH est un site web dédié à la gestion des ressources humaines de la banque UBCI, 
                facilitant le suivi du personnel, la gestion des congés et l'automatisation des tâches administratives.
              </p>
              <div className={classes.buttonContainer}>
                <a
                  href="https://www.creative-tim.com/learning-lab/tailwind/react/overview/notus?ref=nr-index"
                  target="_blank"
                  rel="noopener noreferrer"
                  className={classes.primaryButton}
                >
                  Postuler
                </a>
                <a
                  href=""
                  className={classes.secondaryButton}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  Mon Espace
                </a>
              </div>
            </div>
          </div>
        </div>

        <img
          className={classes.heroImage}
          src={require("assets/img/ubci.jpg").default}
          alt="UBCI Building"
        />
      </section>
      <Footer />
    </>
  );
}
